import axios from 'axios';

const API_URL = 'http://localhost:8184/';

class AplicareJobService {

    sendAplicare(user,job,values) {
        return axios.post(API_URL + 'user/{}/job/{}',user,job,{values})
    }
}

export default new AplicareJobService();
